import React from 'react';
import './App.css';
import { Route } from 'react-router-dom';
import HomePage from './pages/homepage/hoempage.component';
const HatsPage = () => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    <div>
      <Route exact path='/' element={<HomePage />} />
      <Route path='/hats' element={<hatsPage />} />
    </div>
  );
}

export default App;
